import React from 'react';
import './index.css';

function ProjectDashboard({ user, projectId, onLogout }) {
  return (
    <div className="dashboard-container">
      <div className="dashboard-card">
        <h2>Welcome, {user}!</h2>
        <p>You are viewing <strong>Project ID: {projectId}</strong></p>

        <div className="dashboard-buttons">
          <button className="dashboard-button">View Project Details</button>
          <button className="dashboard-button">Update Project Info</button>
          <button className="dashboard-button logout" onClick={onLogout}>Logout</button>
        </div>
      </div>
    </div>
  );
}

export default ProjectDashboard;
